import Layout from '../component/Layout';

const About = () => (
<Layout>
    <div>
        <NavBar/>
        <h1>
           About bItzpRICe
        </h1>
        <p>
            Application to view Bitcoin Prices!
        </p>
    </div>
</Layout>
);

export default About;
